- input: "TEXT\x1CC00002881\x1C15498425\x1C\x1CF3XA\x1C\"The Trucking Political Action
    Committee Of The American Trucking Associations, Inc. (C00002881) filed amendments
    to its February, 2008, March, 2007, and March, 2006, monthly reports as a result
    of findings from a recently completed internal audit of the PAC.  The audit revealed
    that the PAC received three $5,000 contributions that -- at the time of their
    receipt -- the PAC had understood to be permissible funds, but the audit determined
    were from accounts maintained by S-Corps.  In light of this newly discovered evidence,
    the PAC is now refunding the contributions pursuant to 11 C.F.R. 103.3(b)(2).
    \ The amended reports reflect the corporate source of the contributions; the refunds
    will appear on the PAC's next report.\""
